let ADSAccordionComponent = class ADSAccordionComponent {
    constructor(windowRef, cdr) {
        this.windowRef = windowRef;
        this.cdr = cdr;
        this.accordionChange = new EventEmitter();
        this.expanded = false;
        this.chevronPosition = ADSChevronPosition.RIGHT;
        this.id = `ads-accordion-${randomId()}`;
        this.ADSChevronPosition = ADSChevronPosition;
    }
    toggle() {
        this.expanded = !this.expanded;
        this.accordionChange.emit(this.id);
        this.setHeight();
    }
    close() {
        this.expanded = false;
        this.setHeight();
        this.cdr.detectChanges();
    }
    setHeight() {
        const height = this.expanded ? `${this.contentElement?.scrollHeight ?? 0}px` : 0;
        this.regionElement?.setAttribute('style', `height: ${height}`);
    }
    ngAfterViewInit() {
        this.regionElement = this.region?.nativeElement;
        this.contentElement = this.content?.nativeElement;
        fromEvent(this.windowRef, 'resize')
            .pipe(untilDestroyed(this))
            .subscribe(() => this.setHeight());
    }
    ngOnChanges(changes) {
        const { expanded } = changes;
        if (expanded) {
            this.expanded = expanded.currentValue;
            this.setHeight();
        }
    }
};
