let ADSButtonComponent = class ADSButtonComponent {
    constructor(cdr) {
        this.cdr = cdr;
        this.clickEmitter = new EventEmitter();
        this.color = 'primary';
        this.disabled = false;
        this.icon = '';
        this.iconOnly = false;
        this.iconPosition = 'left';
        this.label = '';
        this.tooltip = '';
        this.loading = false;
        this.loadingLabel = 'Loading';
        this.size = 'regular';
        this.type = 'button';
    }
    click(event) {
        if (!this.disabled && !this.isLoading()) {
            this.clickEmitter.emit(event);
        }
    }
    isLoading() {
        return this.loading;
    }
    isDisabled() {
        return this.isLoading() || this.disabled ? true : null;
    }
    isIconOnly() {
        return this.icon !== '' && this.iconOnly;
    }
    displayIcon() {
        return this.icon !== '' && !this.isLoading();
    }
    ngOnChanges(changes) {
        const { notification } = changes;
        if (notification) {
            this.notification = notification.currentValue;
            this.cdr.detectChanges();
        }
    }
};
