class ADSChipComponent {
    constructor() {
        this.avatar = '';
        this.color = 'primary';
        this.disabled = false;
        this.flag = '';
        this.icon = '';
        this.selected = false;
        this.size = 'regular';
        this.type = 'default';
        this.clickEmitter = new EventEmitter();
    }
    displayIcon() {
        return this.icon !== '' && !this.flag && !this.avatar;
    }
    displayAvatar() {
        return this.avatar !== '' && !this.flag;
    }
    displayFlag() {
        return this.flag !== '';
    }
    isDisabled() {
        return this.disabled ? true : null;
    }
    click(event) {
        if (!this.disabled) {
            this.clickEmitter.emit(event);
        }
    }
}
