class ADSEditInPlaceComponent {
    constructor() {
        this.valueChange = new EventEmitter();
        this.isEditing = false;
    }
    startEditing() {
        this.isEditing = true;
        this.copiedValue = this.value;
        setTimeout(() => this.inputRef?.nativeElement.focus(), 0);
    }
    cancel() {
        this.value = this.copiedValue;
        this.isEditing = false;
    }
    finishEditing() {
        if (!this.isEditing)
            return;
        this.isEditing = false;
        if (this.value === this.copiedValue)
            return;
        this.valueChange.emit(this.value);
    }
}
