class ADSFormCheckboxComponent {
    constructor() {
        this.label = 'Checkbox Label';
        this.labelPosition = 'right';
        this.labelColor = 'default';
        this.size = 'regular';
        this.type = 'checkbox';
    }
    /* eslint-disable @typescript-eslint/no-empty-function, @typescript-eslint/no-explicit-any, functional/immutable-data,
       @typescript-eslint/no-unused-vars */
    onChange(value) { }
    onTouched() { }
    registerOnChange(fn) {
        this.onChange = fn;
    }
    registerOnTouched(fn) {
        this.onTouched = fn;
    }
    writeValue(value) {
        // eslint-disable-next-line no-null/no-null
        if (!this.disabled && value !== null) {
            this.model = value;
        }
    }
    onModelChange(event) {
        if (!this.disabled) {
            this.model = event;
            this.onChange(this.model);
        }
    }
}
