let ADSMarkdownComponent = class ADSMarkdownComponent {
    constructor(element) {
        this.element = element;
        this.css = '';
        this.language = 'javascript';
    }
    createMarkdown() {
        const container = this.element.nativeElement.querySelector('#markdown');
        const code = this.code || container.innerText;
        const grammar = Prism.languages[this.language];
        const html = Prism.highlight(code, grammar, this.language);
        if (container) {
            container.innerHTML = `
                <pre class="language-${this.language} ${this.css}">${html}</pre>`;
        }
    }
    copyCode() {
        navigator.clipboard.writeText(this.code);
    }
    ngAfterViewInit() {
        this.createMarkdown();
    }
    ngOnChanges(changes) {
        const { code } = changes;
        if (code) {
            this.createMarkdown();
        }
    }
};
