class ADSStepPanelComponent {
    constructor(cdr) {
        this.cdr = cdr;
        this.selected = false;
        this.finished = true;
        this.displayButtons = true;
        this.previousLabel = $localize `:@@uiComponentStepPanelButtonPrevious:Previous step`;
        this.nextLabel = $localize `:@@uiComponentStepPanelButtonNext:Next step`;
        this.stepChangeEmitter = new EventEmitter();
    }
    next() {
        this.stepChangeEmitter.emit('next');
    }
    previous() {
        this.stepChangeEmitter.emit('previous');
    }
    ngOnChanges(changes) {
        const { finished, selected } = changes;
        if (finished) {
            // eslint-disable-next-line functional/immutable-data
            this.finished = finished.currentValue;
            this.cdr.detectChanges();
        }
        if (selected) {
            // eslint-disable-next-line functional/immutable-data
            this.selected = selected.currentValue;
            this.cdr.detectChanges();
        }
    }
}
